  return (
    <nav className="navbar navbar-dark bg-dark">
        <Link to='/'> 
        <span className="navbar-brand">
          <img id="logoHenry" src={Logo} width="30" height="30" className="d-inline-block align-top" alt="" />
          Climatografia
        </span>
        </Link>
        <Link to='/About'>
          <span>About</span>
        </Link>

    </nav>
  );
};

export default Nav;
